import { Link } from "react-router-dom";
import {
  FaBuilding,
  FaCertificate,
  FaCopyright,
  FaFacebookSquare,
  FaGavel,
  FaGraduationCap,
  FaInstagramSquare,
  FaPhoneSquare,
  FaPhotoVideo,
  FaTwitterSquare,
  FaYoutubeSquare,
} from "react-icons/fa";
import { useState } from "react";

const year = new Date();

function Footer() {

  // ** link set one
  const [links, setLink] = useState([
    {
      to: "#",
      icon: <FaCertificate />,
      text: "Profile",
    },
    {
      to: "#",
      icon: <FaGavel />,
      text: "Services",
    },
    {
      to: "#",
      icon: <FaBuilding />,
      text: "Projects",
    },
  ]);

  //** link set two

  const [links2, setLink2] = useState([
    {
      to: "#",
      icon: <FaPhotoVideo />,
      text: "Gallery",
    },
    {
      to: "#",
      icon: <FaPhoneSquare />,
      text: "Contacts",
    },
    {
      to: "#",
      icon: <FaGraduationCap />,
      text: "Careers",
    },
  ]);
  return (
    <div className="footer">
      <div className="container">
        <div className="footer-grid">
          <div className="nav-footer">
            {links.map((link, index) => (
              <div>
                <Link to={link.to} key={index}>
                  <i>{link.icon}</i>
                  {link.text}
                </Link>
              </div>
            ))}
          </div>
          <div className="nav-footer">
          {links2.map((link, index) => (
              <div>
                <Link to={link.to} key={index}>
                  <i>{link.icon}</i>
                  {link.text}
                </Link>
              </div>
            ))}
          </div>

          <div className="social-icons">
            <i>
              <Link to="#">
                <FaFacebookSquare />
              </Link>
            </i>

            <i>
              <Link to="#">
                <FaTwitterSquare />
              </Link>
            </i>

            <i>
              <Link to="#">
                <FaInstagramSquare />
              </Link>
            </i>

            <i>
              <Link to="#">
                <FaYoutubeSquare />
              </Link>
            </i>

            <p>
              <i>
                <FaCopyright />
              </i>{" "}
              {year.getFullYear()}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
